import React from "react";
import { Link } from "react-router-dom";

const Dashboard = () => {
    const userData = JSON.stringify(Userfront.user, null, 2);
    return (
        <div>
            <h2>Dashboard</h2>
            <pre>{userData}</pre>
            <button onClick={Userfront.logout}>Logout</button>
            <nav>
          <ul>
            <li>
              <Link to="/car">Home</Link>
            </li>
            </ul>
        </nav>
        </div>
    );
};

export default Dashboard;
